using System;\nusing System.Collections.Generic;\nusing System.Linq;\n\npublic class MyObject\n{\n    public int Id { get; set; }\n    // other properties...\n}\n\nclass Program\n{\n    static void Main()\n    {\n        // Creating a list of MyObject\n        List<MyObject> myList = new List<MyObject>\n        {\n            new MyObject { Id = 3 },\n            new MyObject { Id = 1 },\n            new MyObject { Id = 2 }\n        };\n\n        // Converting List<MyObject> to IEnumerable<MyObject>\n        IEnumerable<MyObject> myEnumerable = myList;\n\n        // Running LINQ statements\n        var sortedEnumerable = myEnumerable.OrderBy(mo => mo.Id);\n\n        // If you need to convert back to List<MyObject>\n        List<MyObject> sortedList = sortedEnumerable.ToList();\n\n        foreach (var obj in sortedList)\n        {\n            Console.WriteLine(obj.Id);\n        }\n    }\n}